import React from 'react';
import Stack from '@mui/material/Stack';
import Titulo from './Titulo';

const Texto = () => (
	<>
		<Stack spacing={2}>
			<Titulo />
			<p>Conheça o novo meio de organização de festas</p>
		</Stack>
	</>
)

export default Texto;
